import React from "react";
import menu from "../../assets/images/settings-icon.png";
import settings from "../../assets/images/settings-icon.png";

const Nav = () => {
  return (
    <nav className="nav">
      <img scr={menu} alt="menu icon" className="nav-item" />
      <h2 classname="nav__heading">Ear Worm</h2>
      <img src={settings} alt="settings icon" className="nav-item"/>
    </nav>
  );
};

export default Nav;
